/*Table structure for table `dlc_invoice` */

DROP TABLE IF EXISTS `dlc_invoice`;

CREATE TABLE `dlc_invoice` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `order_sn` varchar(50) COLLATE utf8mb4_bin NOT NULL COMMENT '订单号',
  `invoice_id` varchar(10) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '发票id',
  `pdf_url` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '发票下载地址',
  `invoice_code` varchar(50) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '发票代码',
  `invoice_no` varchar(50) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '发票号码',
  `updated_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `created_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `email` varchar(50) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '电子邮箱',
  `mobile` varchar(30) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '手机号',
  `status` tinyint(1) DEFAULT '0' COMMENT '0 未发送,1 已发送',
  `uid` int(10) NOT NULL COMMENT '用户ID',
  `title` varchar(100) COLLATE utf8mb4_bin NOT NULL COMMENT '发票抬头',
  `type` varchar(50) COLLATE utf8mb4_bin NOT NULL DEFAULT '0' COMMENT '个人|企业',
  `number` varchar(50) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '纳税人识别号',
  PRIMARY KEY (`id`),
  UNIQUE KEY `order_sn_u` (`order_sn`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin;

