  `total_num` int(10) DEFAULT '1' COMMENT '0 商品总件数',
  `open_id` varchar(30) COLLATE utf8mb4_unicode_ci DEFAULT '',
  `payment_at` timestamp NULL DEFAULT NULL COMMENT '预交易订单时间',
  `payment` text COLLATE utf8mb4_unicode_ci COMMENT '预支付信息',
  `payment_type` varchar(20) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT '  1AliPay,2 WeixinPay,3 UnionPay 4HuabeiPay 5 Offline 6 miniapp',
  `transaction_date` date DEFAULT NULL COMMENT '交易日期',
  `trade_type` varchar(20) COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT '详细支付类型',
  `mobile` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT '联系电话',
  `channel` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT '订单来源渠道',
  `order_type` tinyint(1) DEFAULT '1' COMMENT '1 普通订单 2 付邮',
  `province` varchar(30) COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT '省份',
  `district` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT '区/县',
  `city` varchar(30) COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT '城市',
  `zip_code` varchar(20) COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT '邮政编码',
  `has_invoice` tinyint(1) DEFAULT '0' COMMENT '是否有发票信息 0无1有2有开票信息且已开票3小程序已开票',
  `invoice_url` text COLLATE utf8mb4_unicode_ci COMMENT '小程序开票地址',
  `invoice_path` text COLLATE utf8mb4_unicode_ci COMMENT '已开发票地址',
  `invoice_download_url` text COLLATE utf8mb4_unicode_ci COMMENT '发票版式地址',
  `express_no` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '快递单号',
  `received_at` timestamp NULL DEFAULT NULL COMMENT '收货时间',
  `send_at` timestamp NULL DEFAULT NULL COMMENT '发货时间',
  `delivery_mode` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '运输方式EMS EMS \nOTHER 其他（含自提，自送等）\nPOSTB 邮政国内小包 \nSF 顺丰速运 \nSTO 申通E物流\nYTO 圆通速递 \nYUNDA 韵达快运 \nZTO 中通速递',
  `address` varchar(200) COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT '详细地址',
  `contact` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '联系人',
  `payment_id` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '支付id',
  `remark` varchar(1055) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '备注',
  `used_points` int(10) DEFAULT '0' COMMENT '用户使用积分',
  `activity` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT '活动',
  `activity_channel` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT '活动渠道',
  `coupon_code` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT '卷码',
  `coupon_id` int(11) DEFAULT '0' COMMENT '优惠卷id',
  `total_amount` decimal(10,4) DEFAULT '0.0000' COMMENT '实际总金额',
  `total_ship_fee` decimal(10,2) DEFAULT '0.00' COMMENT '运费',
  `total_wrap_fee` decimal(10,0) DEFAULT '0' COMMENT '包装费',
  `total_product_price` decimal(10,4) DEFAULT '0.0000' COMMENT '产品原始金额',
  `total_discount` decimal(10,4) DEFAULT '0.0000' COMMENT '总打折金额',
  `total_point_discount` decimal(10,4) DEFAULT '0.0000' COMMENT '积分抵扣金额',
  `card_from` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT '卡片来自',
  `card_content` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT '卡片内容',
  `card_to` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT '卡片收件人',
  `share_from` int(10) DEFAULT '0' COMMENT '来自分享人',
  `trigger_status` tinyint(4) DEFAULT '0' COMMENT '有数新增订单触发  0：未处理  1：已处理',
  `return_pay_at` timestamp NULL DEFAULT NULL COMMENT '退款时间',
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP,
  `is_sync` tinyint(1) DEFAULT '0' COMMENT '是否已经推送',
