  UNIQUE KEY `index_oms_wms_order` (`wms_order`),
  KEY `index_oms_pos_id` (`pos_id`) USING BTREE,
  KEY `index_oms_user_id` (`user_id`) USING BTREE,
  KEY `status` (`order_status`),
  KEY `state` (`order_state`),
  KEY `payment_type` (`payment_type`),
  KEY `mobile` (`mobile`),
  KEY `contact` (`contact`),
  KEY `index_oms_share_from` (`share_from`),
  KEY `index_oms_guide_id` (`guide_id`),
  KEY `index_oms_share_uid` (`share_uid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

